    }
  return(
    <>
    <form>
    <input value={input} onChange={handleChange} placeHolder='First Name'/>
    <input placeHolder=' Last Name'/>
    <input placeHolder='Age'/>
    <input placeHolder='Address'/>
    <input placeHolder='Homeroom class num...'/>
    <input placeHolder='Student ID'/>
    </form>
    <h1>{input}</h1>
    </>
  )
}
export default Hero;
